import { StyleSheet } from 'react-native';
import Constants from 'expo-constants';

const styles  = StyleSheet.create({

    notComplete: {
        color: 'grey',
        textDecorationLine: 'line-through',
        margin: 5,
      },
      complete: {
        margin: 5,
      },
      fab: {
        position: 'absolute',
        margin: 16,
        right: 0,
        bottom: 0,
        backgroundColor: 'green',
      },
      inputatcomdetail: {
        position: 'absolute',
        margin: 16,
        right: 0,
        bottom: 0,
        backgroundColor: 'grey',
      }
})

export default styles;
